import Link from 'next/link';
import React from 'react';
import fetch from 'isomorphic-unfetch';

export default function Dashboard({ data }) {
	return (
		<div>
			<Link href="/">
				<a title="Dashboard">Create new policy</a>
			</Link>
			<ul>
				{data.map((policy) => (
					<div>
						(key={policy.id}) policy={policy.first_name}
					</div>
				))}
			</ul>
		</div>
	);
}

export async function getServerSideProps() {
	const res = await fetch('http://localhost:4000/policies');
	const data = await res.json();
	return { props: { data } };
}

